607	content	3000	500	\N	2016-07-26 00:00:00	2016-07-26 23:52:08	\N	f		left	top		2.3500			\N	<p>Since 1993 Lizard Skins has created products to meet the needs and wants of cyclists around the world. With a wide variety of cycling products, from its well-known chainstays to its gripping bar tape, Lizard Skins has everything you need to make the most of your ride. Our mission is to protect the bike and rider while making the ride more enjoyable.</p><p>Through hard work ethic and staying tuned to the needs of all types of cyclists, Lizard Skins became a household name in the cycling industry. What began as a small business on a single work table, has now turned into a company with its own manufacturing plant with distributors and customers in 70 countries. Lizards Skins also sponsors top athletes in the sport including Steve Peat, Bubba Harris and Aaron Chase.</p><blockquote>Protect the bike and rider while making the ride more enjoyable.</blockquote><p>We maintain the highest level of quality control and efficiency when producing our Lizard Skins products. Lizard Skins is one of the few remaining businesses in the United States that doesn’t rely only on outsourced production, but also fully operates its company-owned manufacturing plant in the U.S. We define high quality by evaluating every individual item made in-house and outsourced. We inspect every individual item hands on before distribution to ensure our customers receive the best construction, safety and appearance of a Lizard Skins product.</p><p>Using high ethical standards through out our business has enabled us to make long-term connections with dozens of distributors around the world. We care about each individual rider and offer customization to specifically make their cycling a one-of-a-kind experience. With our superb customer service, we have millions of cyclists through out the world who are using our products.</p><p>Lizard Skins travels the world to support athletes, distributors, dealers, and races. Through our travels we have been introduced to some of the best cycling athletes from every genre of cycling. Lizard Skins prides itself in helping well know riders as well as up and coming new athletes get more worldwide exposure in our DVD’s, magazine ads, website content and catalogs. As cyclists, we believe it’s important to take care of our surrounding environment by using reclaimed materials whenever possible and minimizing waste in our day-to-day business.</p><p>Origin of the Name — Lizard Skins: “There were two original founders, myself and Lance Larson. Lance sold out to me in 2001. Lance’s brother was working on a project for a college class that involved creating a name and a logo for a company. He came up with the name Lizard Skins and the original yin and yang style logo. He didn’t have any actual company in mind when he created the name and logo he just thought it would be a cool name and catchy logo. Not sure how well he did on the assignment but I would give him an “A” if I were the teacher. After about one year, Lance asked if he could use the name and logo for a company.Lance’s brother said ‘sure’.”</p><p>Company Beginnings: “It was extremely small. When we started, we could fit the entire business on one table. Our first ad was a twelfth page for Mountain Bike Action magazine. We had to race to FedEx to get it sent out and barely met the deadline for it. We immediately started receiving calls from the ad before we were even really ready to take them. If we had missed that ad deadline, Lizard Skins might have never taken off.”</p>	f	f	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
