223	content	3000	500	\N	2016-06-27 08:51:00	2016-06-27 08:51:05	\N	f		left	top		2.3500			\N	<p>​<strong>We’ve always worked hard to be a green company!</strong></p><p>From the beginning we have always tried to be good to our planet by doing things like sourcing materials as close to home as possible, producing many of our products in our own warehouse, and having our pagacking produced with bio-degradable inks on paper with recycled content.</p><p>So, as Lizard Skins has grown we have worked to do even more to go green. We have replaced our 48 warehouse light fixtures from the traditional metal-halide lights to new high-efficiency florescent reducing our total electricity usage by 30%.</p><p>We implemented recycling programs diverting up to 66% of our solid waste, the program donates all cardboard recycling to a local specials needs program sponsored by the state.</p><p>We have redesigned our packaging to show the recycling emblem on all paper and plastic packaging. We use FSC paper for all the packaging we print in the USA since it is better for the environment. We also switched all our plastic packaging to #1 PET which can be recycled in more places worldwide than any other plastic.</p><p>We know there is always more that can be done which is why we have put together our future goals for going green.</p><ul><li><span>Upgrade key ma</span><span>nufacturing equipment to the most energy efficient </span><span>products available on the market today.</span></li><li><span>We installed 39 solar panels reducing our energy consumption by 1/3.</span></li><li><span>Build or buy a “green” building.</span></li></ul><p>Every day we continue to grow and we are making sure we are helping the environment while we do so.</p><p><img src="/storage/app/media/solar-panels-2.jpg" data-verified="redactor"></p><p>Follow the link to view the amount of energy we have produced with our solar panels at Lizard Skins HQ.</p><p><a title="Lizard Skins Solar Production" href="http://egauge1656.egaug.es/">Lizard Skins Solar Production Gauge</a></p>	f	f	f	221	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
