203	content	3000	500	\N	2016-06-27 07:41:39	2016-06-27 21:35:43	\N	f		left	top		2.3500			\N	<h4>Northshore Grips</h4><p><img src="/storage/app/media/nsmbalogo.png" alt="" rel="float: right; width: 185px; height: 139px; margin: 0px 0px 10px 10px;" data-verified="redactor" data-save-url="/storage/app/media/nsmbalogo.png" width="185" height="139" style="float: right; width: 185px; height: 139px; margin: 0px 0px 10px 10px;">The North Shore mountains of British Columbia are home to some of the most amazing trails in the world. We are not only excited to announce the redesigned Northshore grip but also our new partnership with the North Shore Mountain Biking Association. A percentage of the proceeds from the sales of these grips are used to support the NSMBA and the trail building on the North Shore. The new Northshore grip is our thickest lock-on grip and features a series of textured shock absorbing sections to provide a comfortable and controlled ride.</p><p><br></p><h4>Moab Grips</h4><p><img src="/storage/app/media/mta03color-245x300.jpg" alt="" rel="float: right; width: 163px; height: 201px; margin: 0px 0px 10px 10px;" data-verified="redactor" data-save-url="/storage/app/media/mta03color-245x300.jpg" width="163" height="201" style="float: right; width: 163px; height: 201px; margin: 0px 0px 10px 10px;">Our New Moab grip is inspired by the famous Delicate Arches that exist in Moab, Utah. The Moab grip has a raised texture and works well for those who want a comfortable and forgiving grip. A percentage of the proceeds from the sales of this grip go to support the Moab Trails Alliance and trail building in Moab.\r\n</p><p><br></p><p><br></p>	f	f	f	201	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
