569	slide	3000	500	\N	2016-07-02 21:56:40	2016-07-25 22:40:16	\N	f	Tour de France Stage 1	right	bottom	Mark Cavendish Sprints to <br />Stage Victory and Yellow Jersey	2.3500		Read More...	\N	<p>The opening stage of the 103rd Tour de France came down to a bunch sprint in Utah Beach and Mark Cavendish gave Team Dimension Data for Qhubeka an incredible stage victory and also secured his, and our African Team’s, first ever yellow jersey of the Tour de France.</p><p>Starting in Mont-Saint-Michel, Team Dimension Data for Qhubeka had a clear plan of delivering Cavendish to the sprint finale with the hope of taking the stage victory and the yellow jersey. The 188km stage to Utah Beach suited the sprinters perfectly and so the 5 rider breakaway that did go clear early on, had zero chance of making it to the finish first.</p><p>Etixx-Quickstep and Lotto-Soudal did the lion’s share of the pace making from the peloton while Team Dimension Data for Qhubeka rode near the front, out of trouble, during a nervy stage which saw a number of crashes and splits in the peloton caused by crosswinds. With 5km to go, the race was all together and our African Team started to put our stage plan into action.</p><p>Moving up the left side of the peloton, Bernhard Eisel led Reinardt Janse van Rensburg, Edvald Boasson Hagen, Mark Renshaw and Mark Cavendish to the head of the bunch. Our African Team was shoulder to shoulder with the Belgian Etixx squad, as they had the stage favourite, Marcel Kittel, at the rear of their train.</p><p>After two powerful turns by Janse van Rensburg and Boasson Hagen respectively, our African Team edged ahead as Renshaw led under the 1 kilometer to go sign. Cavendish waited in the wheel of Kittel who had to start sprinting early, before our Manxman burst out of the German’s slipstream with 200m to go, to take a historical victory.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/6519f27b-b97b-43c9-ab35-e82ee82628e1.jpg" data-result="success"></p><p><strong>Mark Cavendish – Rider</strong></p><blockquote><p>This is a very special win. It is the first time I have had the honour of wearing the yellow jersey. What a special moment to do it, with such special people. Three of my last guys, Edvald, Mark and Bernie were guys that have been with me my whole career and to have Reinardt Janse van Rensburg pulling full on for me in the final, it was super emotional for me. In this team, we race for more than just our sponsors, we race to raise the profile of the Qhubeka charity and to put 5000 kids on bicycles. There is no better way to do that than to wear the most iconic symbol in cycling and that’s the yellow jersey. I am very, very happy.</p></blockquote><p><strong>Douglas Ryder – Team Principle</strong></p><blockquote><p>A Tour de France win, our first stage this year, our first yellow jersey, our first year in the World Tour with a new sponsor, this is just unbelievable for this team. The team has an x-factor because it’s got everything going for it at the moment. It has a social cause that everybody really cares about and that the riders believe in. For all the riders to work like they did today, to commit to one objective and one goal and then to pull it off, it is sensational. To wear our first yellow jersey in our second Tour de France and win the first stage, after an incredible start to the season where we had a hugely successful Dauphine, this is an amazing moment for this team. It is amazing for our new partners and for that group came, Bernie, Renshaw and Cavendish, it is incredible how they have integrated with our African riders to make this a special moment for this team and for African cycling.</p></blockquote>	t	f	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
566	slide	3000	500	\N	2016-07-08 21:49:40	2016-07-25 22:40:50	\N	f	Tour De France Stage 7	left	middle	Cummins Wins After Masterclass Solo Performance	1.7800		Read Story ...	\N	<p>A dream 4th stage win for Team Dimension Data for Qhubeka at 2016 Le Tour de France</p><p>Steve Cummings won stage 7 of the Tour de France in typical Steve Cummings fashion, attacking from the original break of the day, to win solo in Lac de Payolle. Daryl Impey (Orica-BikeExchange) made it an even better day for African cycling as the South African finished in 2nd place. Daniel Navarro (Cofidis) was 3rd.</p><p>The 7th stage got off to a fast start with Mark Cavendish and Peter Sagan (Tinkoff) attacking from kilometer zero. 10 other riders joined the Green Jersey contenders but the peloton weren’t content on letting Sagan and Cavendish get away. As soon as their group was caught, the counter attacks started and Team Dimension Data for Qhubeka were fully switched on as Edvald Boasson Hagen made a new break with 3 others. Once again, a few kilometers down the road this break was also caught. The third escape would be the defining move of the day and 29 riders rode clear after 40km of racing, including Cummings.</p><p>Due to the constant attacking, nearly 50km were covered in the first hour and so when the break went clear, the peloton sat up for moment to regain composure which allowed the break to go 5 minutes clear. There were some big names in the escape group, with the yellow jersey race leader, Greg van Avermaet (BMC Racing) also present. With the stage ending after an ascent of the Col d’Aspin, the climbers in the breakaway like Vincenzo Nibali (Astana) and Navarro were definitely the favourites for the stage.</p><p>Cummings was not in favour of reaching the Aspin with this big group and so when Navarro, Antoine Duchesne (Direct Energie) and Matti Breschel (Tinkoff) got a 15 second gap on the lead group, Cummings rode across to the trio and injected some real pace into their attack. This caused a reaction in the chase and the big group split as 9 riders then tried to come across to the 4 leaders. The junction was just about to be made with 26km to go but before the chasers made contact, Cummings counter attacked and went solo.</p><p>The Col d’Aspin was a 12km category 1 climb that topped out 7km before the finish in Lac de Poyolle. The odds were stacked against Cummings as he was alone, being chased by 12 riders who were just 30 seconds behind him when the Aspin began. Everybody thought Nibali and Navarro would be able to bridge the gap to Cummings, and they tried, attacking on the very lowest slopes of the Aspin. Cummings held a consistent pace though and he was totally committed to the move.</p><p>In the end, Cummings even put time into his closest chasers on the Aspin. With the peloton still 4 minutes down on Cummings as he began the descent to the line, he just needed to stay upright to take an incredible victory. Cummings was able to do so with ease and the Brit was even able to savour the moment, crossing the line just more than a minute ahead of Impey. Another unbelievable day for our African Team, as we have now won 4 out of the first 7 stages, a feat we couldn’t have even dreamed of. Mark Cavendish retained the lead in Green Jersey points competition too, ensuring we had two riders on the stage podium today.</p><p><strong>Steve Cummings – Rider:</strong></p><blockquote><p>That was sweet. After what has already happened this week, it is just fantastic to have won. Of all my victories, I think this has to be my best one. I wasn’t confident in that big group and putting pressure on them, I thought, was my best option. The Aspin is also a climb that suits my characteristics. The group behind was obviously on the limit so I just carried on, as you do, and I was able to win. I am really happy for the team and thankful that they believe me. I hope that people are really starting to get that we are racing to put kids on bikes with Qhubeka, it just makes everything that much more special for us and has put the team on a high.</p></blockquote>	t	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
568	slide	3000	500	\N	2016-07-06 21:53:40	2016-07-26 00:29:22	\N	f	Tour de France Stage 3	right	top	Mark Cavendish Powers to Le Tour Stage Win	2.3500		Read More...	\N	<p>Mark Cavendish stole the show during stage 3 of the Tour de France by powering to an incredible photo finish sprint victory over Andre Greipel (Lotto-Soudal). It would be the 28th Tour de France stage win of the Team Dimension Data for Qhubeka sprinters career, and his 2nd victory at this year’s edition of the race after his stage 1 triumph.</p><p>It was a long 223km haul from Granville to Angers, and when only Armindo Fonseca (Fortuneo Vital Concept) tried his luck in the early break, it resulted in a rather pedestrian like stage. Fonseca was allowed a maximum lead of just over 9 minutes as the peloton knew they could bring the lone Frenchman back at will. Thomas Voeckler (Direct Energie) decided to join the lone escapee with 80km to go but being a flat stage, the writing was on the wall, it was going to be a sprint finish.</p><p>Team Dimension Data for Qhubeka were again looking to deliver Cavendish to prime position for the finale in Angers, after extensive research went into the final kilometers of the stage by our African Team. With 8km to go and the break caught, our African Team started putting its plan into action as Bernhard Eisel lined Reinardt Janse van Rensburg, Edvald Boasson Hagen, Mark Renshaw up in front of Mark Cavendish.</p><p>The young South African, Janse van Rensburg, was instrumental in determining the final result as he put in a huge turn from 6.5km to go until 2.5km to go. Boasson Hagen was then in control as the pelotot went under the kilometer to go banner, before Renshaw piloted Cavendish to prime position from where to launch his sprint. The Manxman came off the wheel of the German champion in the final 150m, as both riders lunged for the line. The finish-line photo showed that Cavendish had won by a mere tyres width over Greipel and Bryan Coquard (Direct Energie) took 3rd place.</p><p>Another incredible win for Team Dimension Data for Qhubeka and Mark Cavendish, who is now, with 28 stage wins, tie 2nd with Bernard Hinault for the most number of stage wins at the Tour de France ever. After today’s magnificent team effort, Cavendish moved into the lead in the Green Jersey points competition with 123 points and Peter Sagan (Tinkoff) 2nd, on 116 points.</p><p><strong>Mark Cavendish – Rider</strong></p><blockquote><p>I am incredibly happy with this second win at the Tour de France. We planned it for a long time this morning, we had a long team meeting about how the finish would go and it went pretty much exactly how we planned. It’s good that the guys stayed calm and collected. It would have been easy for them to have pulled and then got out of the way with the hectic final, but they stayed patient. Edvald stayed patient, Mark stayed patient and then at the right minute I was able to get on Andre Greipel’s wheel. I knew he’d hit it early, actually he was stronger than I thought he’d be. Andre has guts, he rides like that. I actually didn’t beat him in the sprint, I beat him with the lunge. This is another great win for the team but more importantly, it raises the profile of Qhubeka yet again, and that is the reason we are here.</p></blockquote>	t	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
571	slide	3000	500	\N	2016-05-24 22:05:40	2016-09-14 18:34:05	\N	f	ALEJANDRO VALVERDE WINS GIRO STAGE 16, ENTERS GC PODIUM!	right	bottom	Alejandro Valverde shatters Giro d’Italia field	1.7800		Read More...	\N	<p>Alejandro Valverde shatters Giro d’Italia field with impressive actitud on stage 16 to Andalo, arguably the most spectacular so far in this ‘Corsa Rosa'; enters podium, Nibali (AST) now at 1’20” as Spanish champion sits just 23″ short of Chaves (OGE), 3’23” to pink jersey</p><p>The most spectacular stage in the 2016 Giro d’Italia (132km between Bressanone and Andalo) was won by a legend in cycling and the leader of the Movistar Team. Alejandro Valverde has turned the dynamics of the ‘Corsa Rosa’ upside down with the gift that turned him into the most consistent rider of the peloton for decades: tenacity. The plan was clear for the Blues, and ‘Bala’ unveiled it after the finish: “Tear the race apart”. Nothing else. Forgetting about power data for a day, without counting the seconds behind his nearest rivals, including Vincenzo Nibali (AST). The only premise today was going on the attack.</p><p>75 kilometers from the finish of Andalo, after good work from the whole telephone squad during the Passo della Mendola climb (Cat-2), Ilnur Zakarin (KAT), Steven Kruijswijk (TLJ) and Valverde himself ultimately broke the peloton after several accelerations. The attacks left Colombia’s Esteban Chaves (OGE) behind, 39″ after the ten-man group led by Valverde into the ‘Traguardo Volante’ of Cles, where ‘Bala’ took a two-second bonus he would multiply at the finish.</p><p>Cards were on the table as Valverde recovered his nonconformist spirit from the Mur de Huy, the Vuelta a Andalucía and already so many races this year, leaving Nibali behind into the Fai della Paganella (Cat-2) ascent and beating Kruijswijk on the last kick up Andalo. The win, Alejandro’s 97th as pro, takes him directly into the selected club of stage victors in all three Grand Tours vueltas (Tour, Giro, Vuelta). Things will calm for a while on Wednesday -196km from Molveno to Cassano d’Adda, with just one Cat-4 climb- before the big finale of this ‘Corsa Rosa’ starts in Piedmont on Thursday.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/059f71e1-ac5a-4b5e-8564-07887a2f370a-1024x683.jpg" data-result="success"></p><p><br><strong>Alejandro Valverde:&nbsp;</strong></p><blockquote><p>“It was an amazing victory. We came to the start fully focused, knowing that it was going to be a really demanding stage for us. We had already inspected it back in March, the three of us – Chente, Andrey and myself. The team worked their hearts out to go for victory today and tear the peloton apart. We really dug deep for the victory, we put all means we had to claim it. The split wasn’t forming up into the first ascent, and the race leader and other rivals were insisting a lot. Happily, we were able to open that gap just before the end of the ascent, with Kruijswijk and without Chaves. We went ahead, pulling all the way to the foot of Fai della Paganella – I think we did a great job, all of us up there.<br><br>“I don’t think it was a really bad day for Nibali. He was keeping up with us all the time during the break and had everything under control. It was just that I attacked into the final ascent, so I could keep the gap against Chaves and reduce the field ahead – those kilometers alone might have costed him a lot. Seeing Kruijswijk doing that well wasn’t a surprise to me, either when he took the leader’s jersey. He’s been already showing for years he can cope well with the Giro, he was arguably the strongest into the final week last season, and this year, he came here with all willingness to win the race. We three, Steven, Zakarin and Myself, insisted until the very end so we could keep that gap. That brought me the win.<br><br>“I already stated during the rest day that my bad day on Saturday was just a consequence of riding in altitude for so long, so many kilometers above 1,700, 1,800 meters. We got through the day as good as we could and later on, we saw at the mountain TT that my physical condition was still near optimal. We just had to go for it today, breaking the peloton into pieces – and we succeeded. The team was phenomenal. I want to thank all of them -mechanics, carers, riders, sports directors- for their dedication. This is a tribute to them, also for my family, my kids and all the fans.<br><br>“It’s true that Kruijswijk’s only weak point so far is his team. Even though we tried to isolate him today, he reacted fantastically well. However, the Giro is far from over. Many demanding stages are left, including Friday and Saturday. We must, however, enjoy today’s win, and also the podium, which makes the final result even better.”</p></blockquote>	f	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
570	slide	3000	500	\N	2016-06-12 21:59:02	2016-07-21 22:24:12	\N	f	TEAM DIMENSION DATA FOR QHUBEKA CLIMBS THE PODIUM 3 TIMES ON THE FINAL CRITERIUM DU DAUPHINE STAGE	right	bottom	Steve Cummings wins stage, Edvald Boasson Hagen and Deaniel Teklehaimanot two classifications	1.7800		Read More...	\N	<p>Stage 7 of the 2016 Critèrium du Dauphiné was another tough one. With six categorized climbs on the menu, Team Dimension Data for Qhubeka wanted to be part of the action to help Daniel Teklehaimanot claim back the Polka Dots jersey as the best climber of the race. In the end our African Team was able to celebrate, as the Eritrean star secured the jersey for the second year in a row. Edvald Boasson Hagen was also able to get onto the podium, taking the overall in the points classification. In addition to that, Steve Cummings delivered the icing on the cake today with his stunning stage win.</p><p>The 151km long stage from Le Pont-de-Claix to Superdévoluy saw an early break of 20 riders. Team Dimension Data for Qhubeka had Teklehaimanot, who was equal on points with overnight KOM classification leader Thibaut Pinot, and Cummings (pictured above) in the group. The peloton, including all the GC contenders, didn’t let them get to far off the front. However, a gap of around two minutes was enough for Teklehaimanot to score the needed points in his fight for glory.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/87979fde-abfd-4891-9dea-ccf0f5579cc2.jpg" data-result="success"></p><p><br></p><p>With roughly 70km to go Cummings attacked the break and took off alone. While his move split the the former break, Teklehaimanot (pictured above) was able to stay in the chase group, allowing Cummings to increase his lead. Over the following kilometers, the British time trial specialist opened up a gap of over 2min over the chasers. With 30km and two climbs to go the peloton was another 2min back.<br><br>Inside the final 15km the peloton, lead by Etixx-QuickStep, picked up the pace and reeled the chase back in. However, Cummings was able to defend his lead and crossed the line in Superdévoluy 3.58min ahead of Daniel Martin (Etixx-QuickStep) and Roman Bardet (Ag2R).</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/924ecd19-69b6-49bc-bdbb-287ca393dc3d.jpg" data-result="success"></p><p>While the overall went to Chris Froome (Sky), it was our African team, who put on a strong show at the Critérium du Dauphiné. With 2 stage wins, as well as the Green jersey and the Polka Dots jersey Team Dimension Data for Qhubeka left its mark in the French Alps.</p>	t	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
