567	slide	3000	500	\N	2016-07-07 21:52:35	2016-08-01 15:22:57	\N	f	TOUR DE FRANCE Stage 6	right	middle	Mark Cavendish Blasts to 3rd Victory<br />for Team Dimension Data for Qhubeka	2.3500		Read More...	\N	<p>The fairy tale Tour de France continued on stage 6 for Team Dimension Data for Qhubeka as Mark Cavendish sprinted to his 3rd victory at this year’s race. Marcel Kittel (Etixx-Quickstep) was 2nd in the lunge for the line and Dan Mclay (Fortuneo-Vital Concept) placed 3rd.</p><p>At 190km from Arpajon-sur-Cere to Montauban, the terrain took in a few undulations but nothing significant enough to stop a big bunch sprint from deciding the final stage outcome. Only 2 riders made the early break of the day and this all but assured that the sprinters would have their day, as Team Dimension Data for Qhubeka, Etixx-Quickstep and Lotto-Soudal had no trouble at keeping the escapees at around 3 minutes for the majority of the day.</p><p>The inevitable catch took place just inside of 15km to go, and this is where things would get really interesting. The road was rather narrow and it meant that the peloton was densely packed, with almost no room for teams to move up. Team Dimension Data for Qhubeka were in the front 3rd of the peloton but there just didn’t seem to be a way through for our leadout team to get to the front.</p><p>The narrow road continued right up until 3km to go and it was clear that a long leadout train was not going to work today. Cavendish just wanted to be taken to the wheel of Kittel, from where he would then freelance to the finish. Our African Team were able to get Cavendish locked on to the German’s wheel after some clever work by Mark Renshaw, and from there our Manxman showed his class. Jumping with around 300m to go, Cavendish came from behind Kittel to forge ahead on the slightly downhill sprint and took another incredible win for Team Dimension Data for Qhubeka.</p><p>While the entire team were working toward the common goal of delivering Cavendish to the finale, Daniel Teklehaimanot, played a huge part in today’s victory as the Eritrean national champion spent close on 150km working at the front of the peloton. This victory comes at the perfect time for our African Team as we begin the big push to get people to sign up for our Qhubeka5000.org challenge. Tomorrow the race will head into the Pyrenees and Mark Cavendish will do so as the leader of the Green Jersey points competition once again.</p><p><strong>Mark Cavendish – Rider:</strong></p><blockquote><p>It was a hot day. Daniel Teklehaimanot did an incredible job to control the breakaway. He was riding super strong actually and he was up there for a long, long time. The guys are getting more and more confident as the race goes on. Steve Cummings was up there fighting with us until the end which was phenomenal, he is a strong guy to keep us there in the final. There were essentially two finish lines, one was at 12km to go and one was at the finish. We were a little bit too far back at the first one but Mark Renshaw did a great job at 4km to go to get me just there and out of a sticky situation. I thought the best wheel to follow in the final was Kittel. It was a fast finish and with the finish line not appearing until late I knew the guys would leave it late because your instincts are not to go before you see the line. I knew Kittel’s wheel was the one to get the biggest slingshot from and with the speed of the finish, I knew if I got a good slingshot I could be going 3-4km/h faster than him before he had time to react so that’s what I did and I was happy to hang on for the win.</p></blockquote>	f	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
572	slide	3000	500	\N	2016-05-20 22:15:08	2016-08-01 15:25:14	\N	f	AMADOR AND THE MAGLIA ROSA!	left	bottom	Andrey Amador makes history again for Costa Rica and Movistar Team	1.7800		Read More...	\N	<p><strong>Andrey Amador makes history again for Costa Rica and Movistar Team: taking over the leader’s jersey in Giro d’Italia after trading blows and attacking on the first big mountain stage.</strong></p><p>Andrey Amador makes history again for Costa Rica and Movistar Team: takes over the leader’s jersey in Giro d’Italia after resisting huge pace into favourites’ group on first big mountain stage</p><p>Flying through the TT course in Apeldoorn, supporting Valverde into the ‘sterrato’ of Alpe di Poti, suffering under the rain in the Chianti hills, making a prodigious descent of the Pian del Falco… and today, in the prelude to the big Dolomites mountains of the weekend, Andrey Amador became the first rider ever from Costa Rica to wear the Maglia Rosa. Perseverance has been the key to the biggest success of Andrey so far. Full constance and commitment have brought the Movistar Team to the top of the Giro d’Italia, thanks to the rider they relied on when they signed them seven years ago.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/amador-1024x683.jpg" data-result="success"></p><p>Stage thirteen of the 2016 ‘Corsa Rosa’ will not only be remembered by Andrey’s overall lead, but also thanks to a fantastic performance from the Blues, which got three of their members into an early, massive breakaway (25 members) through the climb of Montemaggiore (Cat-1): José Joaquín Rojas, Jasha Sütterlin and Carlos Betancur. Into the group containing race leader Bob Jungels (EQS), José Herrada suffocated any further moves, while Alejandro Valverde and Andrey Amador tested the legs of both the pink jersey and the astana team. Both the Blues and Vincenzo Nibali’s squad put Jungels’ consistency into jeopardy until the Luxembourg rider cracked in the last climb, Valle (Cat-2). Ahead, Visconti –who took energies from nowhere to keep fighting, after a serious crash against Cunego (NIP) in Montemaggiore- fought to keep chasing Mikel Nieve (SKY) until the very end, finishing in 2nd place.<br><br>Back at the favourites’ group, and with Amador virtually in pink, Nibali pipped Valverde over the line to take the last four seconds’ bonus and overtaking the Spanish road race champion (now 4th, behind Andrey and Jungels) before the Dolomites. The Queen stage of the Giro d’Italia -210km on Saturday, with six big climbs in the second part of the route from Alpago to Corvara- will see the Movistar Team wearing pink, with two men fighting for overall glory and a reinforced lead in the teams’ classification.</p>	t	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
