577	slide	3000	500	\N	2016-05-09 22:37:06	2016-07-21 22:48:47	\N	f	GIRO D’ITALIA #1: FAST START TO GIRO IN APELDOORN	left	top		2.3500		Read More...	\N	<p><em>All photos by Stiehl Photography</em></p><p>The 99th Giro d’Italia got underway in Apeldoorn with Tom Dumoulin (Giant-Alpecin) taking the stage 1 individual time trial win ahead of Primoz Roglic (LottoNL-Jumbo) and Andrey Amador (Movistar). Dumoulin also secured the first pink leaders jersey of the race.</p><p>In our debut Giro d’Italia, Team Dimension Data for Qhubeka was motivated to race in front of the huge Apeldoorn crowd despite our African Team not having a specialist against the clock. With the start taking place inside the magnificent Apeldoorn Velodrome, it was a great spectacle to be a part of.</p><p>Jaco Venter (pictured at the top) set a good early time over the 9.8km course for our African Team by coming across the finish-line in a time of 11’49”, which would be an average speed of 50km/h. Roglic looked pretty comfortable in the hot seat, that was until Dumoulin started his effort. After passing the intermediate time check 2 seconds faster than anyone else, Dumoulin went on to set the fastest time, beating the mark set by Roglic by just a few hundredths of a second.</p><p>For our African Team, Kanstantsin Siutsou was our last rider to come home and he would also be our best placed finisher on the stage as well. Siutsou set a time of 11’43”, just 40 seconds slower than Dumoulin’s winning effort. All the other riders on our squad had no issues out on the course and we now look forward to tomorrow’s first road stage of the Giro d’Italia.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/13147942_990425857693028_261769529_o-1024x732.jpg" data-result="success"></p><p><strong>Merhawi Kudus – Rider:</strong></p><blockquote><p>Today was a short and fast race, as all prologue time trials are. I was really excited to get the Giro d’Italia started. I didn’t make any big mistakes and the course wasn’t that technical. I’m not too sure yet of my time but I know I can be happy with my result as I did my best. I am happy with how the day went.</p></blockquote><p><strong>Rolf Aldag – Head of Performance:</strong></p><blockquote><p>The most important thing of today is we got everybody home safe. It was a super nice experience to see Holland in pink. There were a lot of fans on the side of the road cheering the riders on. There are another 20 days to go for us, we started to get into our routine today and now we have two more days in Holland before we make our transfer down to Italy.</p></blockquote>	t	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
