574	slide	3000	500	\N	2016-05-18 22:26:25	2016-07-28 17:33:59	\N	f	IBIS CYCLES ENDURO RACE TEAM AT EWS ROUND THREE, IRELAND	right	bottom		2.3500		Read More...	\N	<p>The venue for the third round of the Enduro World Series couldn’t be more different to the opening rounds in Patagonia. A far cry from the Pacific shores and the breathtaking Andes, we headed to the familiar hills of Ireland for one of the riders’ favourite races of the season. Carrick Mountain was the stage for the biggest crowd ever seen at an enduro race last year, and this year things only got bigger. While the hill itself may only rise 350m above sea level, the seven laps the riders faced on race day and the technical nature of the tracks made this as big a challenge as any alpine destination.</p><p style="text-align: center;">We have a little style competition going in the team. Robin boosting the man-made jump on stage six…</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/ibis1.jpg" data-result="success"></p><p style="text-align: center;">And Gary Forrest styling a natural roller by the bluebells:</p><p style="text-align: center;"><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/ibis2.jpg" data-result="success"></p><p><br>As this race is closer to home for most of the team, we skipped the sightseeing and flew in a couple of days before the race to get straight down to business. With practice starting on Friday, there was time earlier in the week to get a couple of days hiking the trails, to check all the lines out on foot, ready for those first practice runs. Come first day of practice the riders tackled stages one through to four, then five through to seven on the second day. With a hill this size it is easy to get carried away and burn yourself out running laps, but you always had to remember that come race day there was a full 50km and 1,700m of climbing to face – you needed to find the fine balance between getting your lines dialed and keeping your legs fresh.</p><p style="text-align: center;">Pedro ‘wheeleeing’ through practice.</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/ibis3.jpg" data-result="success"></p><p>Coming back closer to home did mean that our European mechanic, Jake, could rejoin the team for the first time this season. It makes such a huge difference have someone there who you know has your back and will get your bike dialled in perfectly for race day. His hard work and long hours make such a difference to the team come race day – cheers Jake!</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/jake.jpg" data-result="success"><br>We would not be much without our mechanics, they are the unsung heroes come race day.<br><br>Our Swiss Twin Towers showed their pace this weekend – locking out fourth and fifth in the women’s race. Not only did Anita score her best ever result and Caro equalled her best, but it’s also the best-combined result for the two of them ever. They are running closer than ever on track and it’s going to be a great season as the two of them set their sights on the podium and the equally important goal of top sister. After all, the biggest rivalries are always with those closest to you and the sisters are inseparable!</p><p><img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/Anita-on-her-way-to-her-best-result-at-an-EWS-4th-place.-1024x683.jpg" data-result="success"></p><p><br>Gary Forrest’s comeback from his season-ending injury is 2015 is going well. He finished this weekend in 41st, moving up ten spots compared to the first two rounds – so the strength is starting to come back and with two more months until our next outing in La Thuile he is hoping to be one step closer to where he wants to be.<img class="fr-dib fr-draggable" src="/storage/app/media/uploaded-files/caro.jpg" data-result="success">After the elation of his first top ten in Argentina, Robin Wallner’s luck swung to the other end of the scale this weekend. After a handy 22nd on stage one, a mechanical problem on stage two spelled the end of his weekend. Not one to let such a setback get him down, he headed straight up to the hill to cheer his teammates on.<br><br>A team is greater than the sum of its parts though, and despite our mixed bag of results, we moved forwards in the team ranking. A fifth place this weekend was good enough to move the team into third in the team standings – a huge result for a small team taking on the bigger factory teams.<br><br>The twins were over the moon after getting their best results at the EWS this weekend.</p>	f	t	f	\N	1	\N	t	2	f	f	21	1	t	t				f	\N	bottom	ffffff	f	t	t	f
