631	slide	3000	500	\N	2016-07-28 00:00:00	2016-08-01 15:00:39	\N	f	Why 3 thicknesses	left	bottom		2.3500		Click to Learn More	\N	<p>Lizard Skins has been in business since 1993 manufacturing and distributing bicycle accessories around the world. In January of 2012, Lizard Skins officially launched a new product into the baseball industry.</p><p>DSP (DuraSoft Polymer) bat grip was created based off the highly successful DSP handlebar tape for road bikes. Utilizing our knowledge and experience in developing grips, Lizard Skins designed and created this new innovative bat grip.</p><p>Lizard Skins DSP is unique to the touch with the right combination of softness and tackiness. Our bat grip is engineered with a strategic pattern to ensure non-slip performance and a consistent swing in all weather conditions. Our bat grip reduces vibration and produces a comfortable, cushioned feel. Great comfort, however, doesn’t mean sacrificing control. Our slip-resistant bat grip reduces stress on the hands and body enabling players to lighten their grip pressure. Tension-free swings produce better results at the plate.</p><p><a href="http://lizardskinsbaseball.com/wp-content/uploads/why-3-thicknesses1.jpg"><img src="http://lizardskinsbaseball.com/wp-content/uploads/why-3-thicknesses1-1024x108.jpg" alt="Single Color 9X7 New" data-wp-pid="1292" class="fr-dii fr-draggable"></a></p><p>Our expertise in grips helped us foresee that players wanted different options to customize the feel and thickness of their bat handle. Unfortunately, bat manufacturers and aftermarket grips sold at retail had never specified the grip size. As a result, Lizard Skins created the thickness category. DSP bat grip was originally released in two different thicknesses – 1.8 mm to match average industry sizes and 1.1 mm to provide a new thinner option. After further testing, a key group of MLB players requested an even thinner grip that would provide all the same gripping properties but not increase the handle thi